@import 'transition-style';
@font-face {
  font-family: 'Arial Regular';
  src: url('fonts/PixelArialRegular.TTF') format('truetype');
  font-weight: normal;
  font-style: normal;
}
@font-face {
  font-family: 'Arial Bold';
  src: url('fonts/PixelArialBold.TTF') format('truetype');
  font-weight: bold;
  font-style: normal;
}

:root {
  --beaver-blue: #1e407c;
  --beaver-70: rgba(30, 64, 124, 0.7);
  --beaver-80: rgba(30, 64, 124, 0.8);
  --link: #005fa9;
  --nittany-navy: #001e44;
  --potential-midnight: #000321;
  --potential-75: rgba(0, 3, 33, 0.75);
  --potential-60: rgba(0, 3, 33, 0.6);
  --pugh-blue: #96bee6;
  --limestone-gray: #a2aaad;
  --limestone-light: #e4e5e7;
  --original-87-pink: #bc204b;
}

*,
*::before,
*::after {
  box-sizing: border-box;
  user-select: none;
}

*:focus {
  outline: 2px dashed rgb(169, 169, 169);
  outline-offset: 5px;
}

body {
  image-rendering: pixelated;
  margin: 0;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 12px;
  letter-spacing: 1.5px;
  min-height: 100vh;
  transition: all 0s;
}

button {
  cursor: pointer;
}

body.pause-animation * {
  animation-play-state: paused !important;
}

#blackScreen {
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  background-color: black;
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
}

.foreground {
  --left: 0;
  position: absolute;
  width: 250%;
  bottom: 0;
  z-index: -1;
  left: calc(var(--left) * 1%);
}

.foreground-trees {
  --left: 0;
  filter: brightness(70%);
  position: absolute;
  width: 220%;
  bottom: -20%;
  z-index: -1;
  left: calc(var(--left) * 1%);
}

.foreground-trees-layer2 {
  --left: -20;
  opacity: 0.3;
  position: absolute;
  width: 240%;
  bottom: -18%;
  z-index: -1;
  left: calc(var(--left) * 1%);
